    const [state, setstate] = useState(initialState)
    return (
        <div className='channel'>
            <div className='channel_title'>
                <FaHashtag />
                <p className='channel_title_text'>siema</p>
            </div>
            <BsX className='channel_remove' />
        </div>
    )
}

export default Channel
